import { makeStyles } from '@mui/styles';

export default makeStyles(() => ({
  container: {
    background: 'rgba(13, 22, 33, 0.9)',
    height: '80px',
  },
  title: {
    fontFamily: 'Copperplate',
    fontStyle: 'normal',
    fontWeight: 'normal',
    fontSize: '24px',
    lineHeight: '25px',
  },
  subtitle: {
    fontFamily: 'Copperplate',
    fontStyle: 'normal',
    fontWeight: 'normal',
    fontSize: '12px',
    lineHeight: '12px',
  }
}))
